import React from 'react'

export const Header = (props) => {

    return (
       <header>
           <label htmlFor=''>
               Buscar Heroi:
               <input type='text' value={props.search} />

           </label>
           <input type="button" value="Search" onClick={props.setSearch(props.search)}/>
       </header>
    )
}
